// import { Navbar } from 'bootstrap5';
import React from 'react';
import { Outlet } from 'react-router-dom';
import Navbar from './Navbar';
import { Provider } from 'react-redux';

function RootLayout(props) {
    return (
        <>
        <Provider></Provider>
            <Navbar / >
            <main>
                <Outlet />
            </main>
        </>
    );
}

export default RootLayout;
